import React, { useEffect, useState } from 'react'
import { Table } from 'react-bootstrap';
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
import { Link } from 'react-router-dom';
import './App.css';

export default function CreateStudent() {
  return (
    <div className="container mt-4">
    <Card className="col-md-5 mx-auto" style={{ width: "80%" }}>
      <Card.Body>
        <Card.Title className="text-center">Create Student</Card.Title>
        <form>
          <label htmlFor="sid">ID</label>
          <input type="text" id="sid" name="sid" />

          <label htmlFor="snsme">Name</label>
          <input type="text" id="snsme" name="snsme" />

          <label htmlFor="semail">Email</label>
          <input type="text" id="semail" name="semail" />

          <label htmlFor="id">Phone</label>
          <input type="text" id="id" name="id" />

          <label htmlFor="id">Place</label>
          <input type="text" id="id" name="id" />
        </form>
        
      </Card.Body>
    </Card>
  </div>
  )
}
